import { Box, Grid, Typography } from '@mui/material';
import '../../style/footer.css';

function Footer() {
  return (
    <footer className="footer">
      <Box
        style={{
          backgroundColor: 'black',
          width: '100%',
          height: 100
        }}
      >
        <Grid container spacing={2}>
          <Grid xs={6}>
            <Typography>xs=8</Typography>
          </Grid>
          <Grid xs={6}>
            <Typography>xs=4</Typography>
          </Grid>
          <Grid xs={4}>
            <Typography>xs=4</Typography>
          </Grid>
          <Grid xs={8}>
            <Typography>xs=8</Typography>
          </Grid>
        </Grid>
      </Box>
    </footer>
  );
}
export { Footer };
